import React, { useState, useEffect } from 'react'
import $ from 'jquery';
import {
  CBadge,
  CCard,
  CCardBody,
  CCardHeader,
  CCol,
  CDataTable,
  CModal,
  CModalBody,
  CModalFooter,
  CModalHeader,
  CModalTitle,
  CButton,
  CTabs,
  CNav,
  CNavItem,
  CNavLink,
  CTabContent,
  CTabPane,
  CRow
} from '@coreui/react'
import { DocsLink } from 'src/reusable';

import ManageData from '../../users/ManageData';
import InformationTab from './InformationTab';
import IntarectionTab from './IntarectionTab';
import PurchasesTab from './PurchasesTab';
import ActivitesTab from './ActivitesTab';
import EditTab from './EditTab';
import HistoryTab from './HistoryTab';
import AdduserModal from './AdduserModal';

import Cookies from 'universal-cookie';
import BASE_URL from 'src/views/base';
const cookies = new Cookies();
console.log(cookies.get('gym_uuid'))
const getBadge = status => {
  switch (status) {
    case 'Active': return 'success'
    case 'Inactive': return 'secondary'
    case 'Pending': return 'warning'
    case 'Banned': return 'danger'
    default: return 'primary'
  }
}


const fields = ['id', 'name', 'user', 'created', 'ageGroup', 'status', 'action']

const CustomerHistory = () => {

  const [blog, setBlog] = useState([])
  const axios = require('axios');
  useEffect(() => {
    axios
      .get(BASE_URL + 'user/subscribed/userslist/?gym_id=' + cookies.get('gym_uuid'))
      .then(res => {
        console.log(res)
        setBlog(res.data)
      })
      .catch(err => {
        console.log(err)
      })
  }, [])

  const [modal, setModal] = useState(false)
  const [large, setLarge] = useState(false)
  const [small, setSmall] = useState(false)
  const [primary, setPrimary] = useState(false)
  const [success, setSuccess] = useState(false)
  const [warning, setWarning] = useState(false)
  const [danger, setDanger] = useState(false)
  const [info, setInfo] = useState(false)
  const [blog2, setblog2] = useState(false)
  const [blog3, setblog3] = useState([])
  const [activity, useractivity] = useState([])
  const [bookedclass, userclass] = useState([])
  const [finduser,setsearch] = useState([])

  const [active, setActive] = useState(1)
  const lorem = 'Lorem 1 ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit.'


  function Search(){

    var ser = document.getElementById('ser').value;

    axios
      .get(BASE_URL + 'user/search_user/?first_name='+ ser + '&gym=' +  cookies.get('gym_uuid'))
      .then(getuuid => {
        console.log(getuuid);
        setsearch(getuuid.data);
      })

  }

  function Clicker(uuid) {
    setLarge(!large);

    axios
      .get(BASE_URL + 'user/' + uuid)
      .then(getuuid => {
        console.clear();
        console.log(getuuid);
        setblog2(getuuid.data);
      })


    axios
      .get(BASE_URL + 'user/userhistory/' + uuid + '/?gym_id=' + cookies.get('gym_uuid'))
      .then(getuuid => {

        console.log(getuuid);
        setblog3(getuuid.data);
      })

      .catch(err => {
        console.log(err);
      })


    axios
      .get(BASE_URL + 'user/subscription/user/?uuid=' + uuid + '&gym_id=' + cookies.get('gym_uuid'))
      .then(getuuid => {

        console.log(getuuid);
        useractivity(getuuid.data);
      })

      .catch(err => {
        console.log(err);
      })

    axios
      .get(BASE_URL + 'user/bookclass/list/?uuid=' + uuid + '&gym_id=' + cookies.get('gym_uuid'))
      .then(getuuid => {
        //  debugger
        console.log(getuuid);
        userclass(getuuid.data);
      })

      .catch(err => {
        console.log(err);
      })
  }

  async function UserUpdate() {

    var username = document.getElementById("username").value;
    var first_name = document.getElementById("first_name").value;
    var last_name = document.getElementById("last_name").value;
    var phone_number = document.getElementById("mobile").value;
    var dob = document.getElementById("dob").value;
    var address = document.getElementById("address").value;
    var profile_picture = document.querySelector("#profile_image");
    var uuid = document.getElementById("uuid").value;


    var data = new FormData();
    data.append("username", username);
    data.append("first_name", first_name);
    data.append("last_name", last_name);
    data.append("phone_number", phone_number);
    data.append("dob", dob);
    data.append("address", address);
    data.append("profile_picture", profile_picture.files[0]);
    data.append("uuid", uuid);

    try {
      console.log('Trying')

      var config = {
        method: "patch",
        url: BASE_URL + 'user/userupdate/',
        headers: {
          "content-type": `multipart/form-data; boundary=${data._boundary}`,
        },
        data: data,
      };

      await axios(config)
        .then(function (res) {

          console.log(JSON.stringify(res.data));

          if (res.status === 200) {

              if (res.status === 200) {
              window.location.reload();

            }
            else {

              alert("BAD REQUEST");
            }
          }

          return res.data
        })


    }
    catch (err) {

      console.error(err);

    }
  }

  async function CSVExport(data){
    //  debugger

    {

      console.log('Trying to send request');

      try {
          console.log('Trying');
          let res = await axios.post(BASE_URL + 'user/export/csv/', {

            data:data,
            gym_id: cookies.get('gym_uuid'),

          });
          if (res.status === 200) {
            //  debugger
            // test for status you want, etc
            console.log(res.data.data);
            // setreports(res.data.data);
            // alert(res.data.message);
          }
          //  debugger
          // Don't forget to return something
          return res.data
      }
      catch (err) {
          console.error('Signup Failed , Please try again.');
          window.location.reload()
          alert(err);
      }
  }
  }

  async function civil(){
    //  debugger
    var civil_id = document.getElementById('civil_id').value;
    var uuid = document.getElementById("uuid").value;

    {  
      console.log('Trying to send request');

      try {
          console.log('Trying');
          let res = await axios.patch(BASE_URL + 'user/userupdate/', {

            civil_id:civil_id,
            uuid:uuid,

          });
          if (res.status === 200) {
              //  debugger
              // test for status you want, etc
              console.log(res.status);
              console.log(res.data);
              // alert(res.data.message);

              window.location.reload();


          }
          //  debugger
          // Don't forget to return something
          return res.data
      }
      catch (err) {
          console.error('Signup Failed , Please try again.');
          window.location.reload();
          alert(err);
      }
  }
  }
  var perm = cookies.get('perms')

  if (perm.includes('CRM')){
  return (
    <>
      <CRow>
        <div className="col-md-12">
          <div className="manage_top_btn">
            <div className="manage-btn-left">
              <button className="mn_btn_1"> <i class="fa fa-refresh" aria-hidden="true"></i> Refresh list </button>
              {/* <button className="mn_btn_1 mr-1" onClick={() => setPrimary(!primary)}> <i class="fa fa-plus-circle" aria-hidden="true"></i> Add new user </button> */}
              <button className="mn_btn_1" onClick={()=>CSVExport()}> <i class="fa fa-file-excel-o" aria-hidden="true"></i> Export to excel </button>
              {/* <button className="mn_btn_1 mr-1" onClick={() => setSuccess(!success)}> <i class="fa fa-user" aria-hidden="true"></i> Customer authentication </button> */}
              <button className="mn_btn_1 mr-1" onClick={() => setDanger(!danger)}> <i class="fa fa-search" aria-hidden="true"></i> Search </button>
            </div>
            <div class="btn-group group-btn-main">
              <button type="button" class="btn btn-primary">All</button>
              <button type="button" class="btn btn-success">Active</button>
              <button type="button" class="btn btn-warning">Inactive</button>
              {/* <button type="button" class="btn btn-danger">Blocked</button> */}
            </div>

          </div>

        </div>
        <CCol xs="12" lg="12">
          <CCard>

            <div className="col-md-12">
              <div className="manage-table-main">
                <table class="table">
                  <thead>
                    <tr>
                      <th>Name</th>
                      <th>User Id</th>
                      <th>Created On</th>

                      <th>Status</th>
                      <th>Action</th>
                    </tr>
                  </thead>
                  <tbody>

                    {blog.map(store => (
                      <tr>
                        <td>{store.first_name + ' ' + store.last_name}</td>
                        <td>{store.unique_id}</td>
                        <td>{store.created_at}</td>
                        <td>  <button type="button" class="btn btn-success">Active</button>  </td>
                        {/* <td>  <button type="button" class="btn btn-danger">Inactive</button> </td> */}

                        <td><CButton color="primary" onClick={() => Clicker(store.uuid)}>View</CButton>{' '} </td>
                      </tr>
                    ))}

                  </tbody>
                </table>

              </div>
            </div>


          </CCard>
        </CCol>
      </CRow>



      {/* manage popup start here */}
      <CModal
        show={large}
        onClose={() => setLarge(!large)}
        size="lg"
      >
        <CModalHeader className="add-user-modal" closeButton>
          <CModalTitle>Manage</CModalTitle>
        </CModalHeader>

        <CModalBody>

          <div className="manage-tab-main">
            <CCardBody>
              <CTabs>
                <CNav variant="tabs">
                  <CNavItem>

                    <CNavLink>
                     Profile
                  </CNavLink>
                  </CNavItem>
                  <CNavItem>
                    <CNavLink>
                      Interactions
                  </CNavLink>
                  </CNavItem>
                  <CNavItem>
                    <CNavLink>
                      Purchases
                  </CNavLink>
                  </CNavItem>
                  <CNavItem>
                    <CNavLink>
                      Activities
                  </CNavLink>
                  </CNavItem>
                  {/* <CNavItem>
                    <CNavLink>
                      Edit
                  </CNavLink>
                  </CNavItem> */}
                  <CNavItem>
                    <CNavLink>
                      History
                  </CNavLink>
                  </CNavItem>
                  {/* <CNavItem>
                    <CNavLink>
                      Profile
                  </CNavLink>
                  </CNavItem> */}
                </CNav>
                <CTabContent>
                  {/* ------------------------------INFORMATION PAGE------------------------------------- */}
                  <CTabPane>
                    <div className="tab-pane-main">
                      <CCard>

                        <CCardHeader>
                          <i class="fa fa-info-circle" aria-hidden="true"></i>
                Personal Information

                </CCardHeader>

                      </CCard>

                      <div className="tab-title ">
                        <h4>{blog2.first_name + ' ' + blog2.last_name}</h4>
                        <p>
                          <i class="fa fa-envelope" aria-hidden="true"></i>
                          <strong>Email </strong><span>: {blog2.email} </span>
                        </p>

                        <p>
                          <i class="fa fa-id-card" aria-hidden="true"></i>
                          <strong> Username </strong><span>:{blog2.username}</span>
                        </p>

                        {/* <p>
                    <i class="fa fa-phone " aria-hidden="true"></i> 
                    <strong> User ID </strong><span>: Lorem ipsum </span> 
                    </p> */}

                        <p>
                          <i class="fa fa-phone " aria-hidden="true"></i>
                          <strong> Mobile </strong><span>: {blog2.phone_number}</span>
                        </p>

                        <p>
                          <i class="fa fa-genderless " aria-hidden="true"></i>
                          <strong> Gender  </strong><span>:{blog2.gender} </span>
                        </p>

                        <p>
                          <i class="fa fa-birthday-cake" aria-hidden="true"></i>
                          <strong> DOB </strong><span>:{blog2.dob} </span>
